import React from "react";
import './About.css';
import { HiDownload } from 'react-icons/hi';
import { HiEye } from 'react-icons/hi';

const About = () => {
  return (
    <section id="about" className="about-section">
      <div className="about-container">
        <h2 className="about-title">About Me</h2>
        <p className="about-description">
          Crafting stunning, responsive, and high-performance websites that blend design & functionality. I build fast, user-friendly, and SEO-optimized web experiences to help businesses grow. Let's turn your vision into a beautiful, interactive, and powerful website that stands out online!
        </p>
        <div className="about-buttons">
          <button className="about-button-primary">
            <HiDownload className="button-icon" />
            Download CV
          </button>
          <button className="about-button-outline">
            <HiEye className="button-icon" />
            View Projects
          </button>
        </div>
      </div>
    </section>
  );
};

export default About;
